import { FormControl, TextField } from "@mui/material";
function Form() {
  return (
    <>
    <FormControl>
        <TextField type='text' placeholder='name'  sx={{margin:'20px'}}/>
        <TextField type='email' placeholder='email'  sx={{margin:'20px'}} />
        <TextField type='password' placeholder='password'  sx={{margin:'20px'}}/>

    </FormControl>
      
    </>
  )
}

export default Form;
